style.css:
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);
/* using this style and the "Showcase" addon >
https://addons.mozilla.org/en-US/firefox/addon/showcase/?src=ss you can -
move the Sidebar horizzontally to the Bottom - 
add the gradient colors background -
add the dock -
show the tabs tumbnails with a ZoomIn effect on hovering the mini blue sidebar at center bottom 
and ZoomOut on focus lost -

If you don't care about the search box as I did open about:config 
and set the integer value extensions.showcase.sidebarFindBarMode to 2

the dock is the mix of two of mine:
SpotLightDock > http://www.wincustomize.com/explore/objectdock/16956/ 
and NeonDock > http://www.wincustomize.com/explore/objectdock_backgrounds/368/

thanks to deft  > http://userstyles.org/styles/91562/auto-hide-sidebar-for-firefox-default-style
and dotter Ben  > http://userstyles.org/styles/8817/firefox-showcase-custom-backgroun
special thanks to hideheader for the help to exclude the other Sidebars (Bookmarks, History, Stylish etc.)
*/


#sidebar-box[src="chrome://showcase/content/showcaseSidebar.xul"] {
-moz-appearance: none !important;
position: fixed !important;
top: 95.5% !important;
left: 50% !important;
height: 12px !important; 
width: 22px !important;
margin: 0px !important;
padding: 0 !important;
overflow:hidden !important;
border: solid 0.2em lightblue;
border-bottom-color: lightblue;
box-shadow: 0px 0px 1px 1px gray inset, 0px 0px 1px 1px white;
border-radius: 3px !important;
opacity: 0.6 !important; 
transition: 0.6s linear !important;
-moz-transition-delay: 0.6s !important;
}
    
#sidebar-box:hover[src="chrome://showcase/content/showcaseSidebar.xul"] {
max-width: none !important; 
top: 82.5% !important;
left: 2% !important;
width: 96% !important; 
height: 140px !important;
border: 2px solid silver !important;
border-radius: 15px 15px 15px 15px !important;
opacity: 0.9 !important;
transition: 0.1s linear !important;}
#sidebar {max-width: none !important; 
min-width: 0 !important;
width: 100% !important; 
height: 140px !important;
border-bottom-right-radius:5px !important;}    
#sidebar-box > #sidebar-header {display: none !important;}
#sidebar-box:hover > #sidebar-header {visibility: visible  !important;}
#sidebar-box[src="chrome://showcase/content/showcaseSidebar.xul"] + #sidebar-splitter 		{display: none !important;}


#showcase-box,
#showcase-content-horizontal

{-moz-box-orient: horizontal !important; 
-moz-box-align: stretch !important; 
border-width: 0 2px 0 0px !important; 
border-style: solid !important;
border-image: url(data:image/png;base64,) 
0 6 0 2 fill stretch !important; 
margin-bottom: 0px !important;
margin-top: 0px !important;
font-weight:bold !important; 
font-size: 10px !important; 
color:#FFFFFF !important;
text-shadow: black 1px 1px 1px !important;

background-color:hsla(210,50%,85%,1)!important;
background:-moz-radial-gradient(center bottom,hsla(210,60%,65%,1),transparent),-moz-linear-gradient(center top,hsla(210,55%,17%,1),hsla(190,55%,8%,1)),-moz-linear-gradient(hsla(190,55%,25%,.7), hsla(190,55%,25%,.2) 85%,hsla(190,55%,25%,.4))!important;
box-shadow:0 1px 4px hsla(190,60%,65%,.4)!important;
}
